function start(data) {
	var dataObject = jQuery.parseJSON( data );

	if (dataObject.heatDataName != null) 
		heatDataName = dataObject.heatDataName;
	
	for (i = 0; i < dataObject.dataSeries.length; i++) {
		rateById.set(dataObject.dataSeries[i].locationId, new HeatLocation(dataObject.dataSeries[i]));
		valueArray.push(dataObject.dataSeries[i].heatValue);
	}
	
	valueArray.sort(function(a, b) { return a - b; });
	setColorScale(valueArray);
	
	determineIfStateOrCountyData(dataObject);

	queue()
		.defer(d3.json, "js/usheatmapdata/us.json")
		.await(ready);
};

function determineIfStateOrCountyData(dataObject) {
	var stateCodes = 0;
	var countyCodes = 0;
	
	for (i = 0; i < dataObject.dataSeries.length; i++) {
		var locationIdAsNumber = (Math.round(dataObject.dataSeries[i].locationId * 100) / 100);
		if (locationIdAsNumber > 0 && locationIdAsNumber < 100)
			stateCodes++;
		if (locationIdAsNumber > 1000 && locationIdAsNumber < 100000)
			countyCodes++;
	}
	
	if (stateCodes > countyCodes)
		countyData = false;
	else
		countyData = true;
}

function ready(error, us) {
	if (error)
		throw error;
	
	usMapData = us;
	
	var decimalToKeep = determineHowManyDecimalsToKeep(valueArray);
	initSlider('slider', valueArray, decimalToKeep);
	initColorChooserAndAddToEndOfHtmlElementWithId("nav");

	initVisualization();
	updateVisualization();
}

function initVisualization() {
	var stateOrCountyVizData = usMapData.objects.states;
	if (countyData) {
		stateOrCountyVizData = usMapData.objects.counties;
	}

	var tip = d3.tip()
		.attr('class', 'd3-tip')
		.html(function(d) { return getTipForId(d.id); });
	tip.direction('s');

	var svg = d3.select("#heatmap").append("svg")
		.attr("width", width)
		.attr("height", height)
		.append("g")
		.attr("transform", "translate(" + 0 + "," + verticalOffsetToAccountForNavBar + ")")
		.attr("class", "statesAndCounties");
	
	var heatmap = svg.selectAll("path")
		.data(topojson.feature(usMapData, stateOrCountyVizData).features)
		.enter().append("path")
		.style("fill", function(d) { return getColorForId(d.id) })
		.on('mouseover', tip.show)
		.on('mouseout', tip.hide)
		.attr("d", path);

	heatmap.call(tip);
}

function updateVisualization() {
	currentColor = $('#colorChooser').attr('value');

	//Readjust the color-scale to take into account the new data range
	//after adjusting the slider:
	var valueArrayUpdated = [];
	var domainArray = $('#slider').data('slider').getValue();
	for(i = 0; i < valueArray.length; i++){
		if(valueArray[i] >= domainArray[0] && valueArray[i] <= domainArray[1]){
			valueArrayUpdated.push(valueArray[i]);
		}
	}
	
	setColorScale(valueArrayUpdated);

	d3.selectAll("path")
		.style("fill", function(d) { return getColorForIdsInRange(d.id, domainArray[0], domainArray[1]); });

	$('#legend').html( buildLegendHtml(valueArrayUpdated.sort(function(a, b) { return a - b; })) );
}